import React from 'react';
import { createRoot } from 'react-dom/client'; // React 18에서 변경된 임포트 방식
import ReactFullpage from "@fullpage/react-fullpage";
import "./styles.css";

const SEL = "custom-section";
const SECTION_SEL = `.${SEL}`;

const pluginWrapper = () => {
};

const originalColors = [
  "#ff5f45",
  "#0798ec",
  "#fc6c7c",
  "#435b71",
  "orange",
  "blue",
  "purple",
  "yellow"
];

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      sectionsColor: [...originalColors],
      fullpages: [
        {
          text: "Page 1"
        },
        {
          text: "Page 2"
        },
        {
          text: "Page 3"
        }
      ]
    };
  }

  onLeave(origin, destination, direction) {
    console.log("onLeave", { origin, destination, direction });
    // arguments are mapped in order of fullpage.js callback arguments do something
    // with the event
  }

  render() {
    return (
      <div className="App">
        <ReactFullpage
          debug /* Debug logging */
          pluginWrapper={this.pluginWrapper}
          licenseKey={"YOUR_KEY_HERE"} // Get one from https://alvarotrigo.com/fullPage/pricing/
          navigation
          anchors={["firstPage", "secondPage", "thirdPage", "fourthPage"]}
          sectionSelector=".section"
          slidesNavigation={true} // Enable navigation bullets for slides
          onLeave={this.onLeave.bind(this)}
          render={({ state, fullpageApi }) => (
            <ReactFullpage.Wrapper>
              <div className="section" id="page1">
                <p>1 page</p>
              </div>
              <div className="section">
                <div className="slide" id="page2-1"><p>page 2-1</p></div>
                <div className="slide"><p>page 2-2</p></div>
                <div className="slide"><p>page 2-3</p></div>
              </div>
              <div className="section" id="page3-1">
                <p>3 page</p>
              </div>
              <div className="section">
                <p>4 page</p>
              </div>
            </ReactFullpage.Wrapper>
          )}
        />
      </div>
    );
  }

}
export default App;

// 수정된 부분: ReactDOM.render() 대신 createRoot 사용
const container = document.getElementById('react-root');
const root = createRoot(container); // createRoot로 루트 생성
root.render(<App />);
